import { Link, BrowserRouter as Router, Routes, Route } from "react-router-dom";
import React from "react";

const CustomRouter = () => {
  return (
    <Router>
      <div>
        <Link to="/home" />
        <Link to="/caught" />
        <Routes>
          <Route path="/home">this is home</Route>
          <Route path="/caught">this is caught</Route>
        </Routes>
      </div>
    </Router>
  );
};

export default CustomRouter;
